// ApiBc49.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Table } from 'react-bootstrap'
import '../App.css'
import classNames from 'classnames'

const ApiNumbers = ({ endpoint }) => {
    const [data, setData] = useState([]);

    useEffect(() => {
        // Fetch data from the specified endpoint
        axios.get(endpoint)
            .then(response => {
                setData(response.data.data);
            })
            .catch(error => {
                console.error('Error fetching data:', error);
            });
    }, [endpoint]);

    const getHeader = () => {
        /* console.log(data.slice(0,1).Numbers); */

        if (Array.isArray(data) && data.length > 0) {
            console.log(data[0].Numbers);
        } else {
            console.log("Data is not an array or is empty.");
            console.log(data.DrawNumber);
        }
        return (
            <tr>
                <th className="text-light bg-info">Draws</th>
                <th className="text-light bg-info">Date</th>
                {/*  {data.Numbers.map(row => 
                    <th key={row.Value} className="text-light bg-info">{row.Value}</th>
                )} */}
            </tr>
        )
    }

    return (
        <div className="card">
            {data !== null ? (
                <>
                    <span className='App-link'>{endpoint}</span>
                    <Table responsive className="table-default mb-4" size="sm" hover="true">
                        <thead className="table-danger text-center"> {getHeader()} </thead>
                        <tbody >
                            <td>{data.DrawNumber}</td>
                            <td>{data.DrawDate}</td>
                            {data.Numbers.map(item => (
                                <td key={item.Value} className="text-warning bg-primary">{item.Value}({item.Distance}, {item.IsHit === true ? 1 : 0}, {item.NumberOfDrawsWhenHit}, {item.IsBonusNumber === true ? 1 : 0}, {item.TotalHits})</td>
                            ))}
                        </tbody>
                        {/*  <thead className="table-danger text-center"> {getHeader()} </thead> */}
                    </Table>
                </>
            ) : ''}
        </div>
    )
}

export default ApiNumbers
